import React from "react";
import { Wrapper,LogoWrapper, IconsWrapper, Line, Image, StyledText, IconBase } from "./Footer.styled";
import logo from '../../../assets/farm-barn-icon.png';
import Icon, {
    TwitterOutlined,
    InstagramOutlined,
    LinkedinOutlined,
    YoutubeOutlined
  } from "@ant-design/icons";

const Footer = () => {
  return (
    <Wrapper>
      <LogoWrapper>
        <Image>
            <img class="Logo" src={logo} alt="Logo" />
        </Image>
        <h1>My Farm</h1>
      </LogoWrapper>
      <Line />
      <IconsWrapper>
          <IconBase component={YoutubeOutlined} color='#000000'/>
          <IconBase component={TwitterOutlined} color='#000000' />
          <IconBase component={LinkedinOutlined} color='#000000'/>
          <IconBase component={InstagramOutlined} color='#000000'/>
      </IconsWrapper>
      <Line />
      <StyledText>Â© Farm all rights reserved</StyledText>
    </Wrapper>
  );
};

export default Footer;
